import React from "react";
import logo from './logo.svg';

function Welcome (props){
    return <h1>Bonjour {props.name}</h1>
}

function Avatar(){
    return(
        <img 

            className="Avatar"
            src={logo}
            alt="logo"
            width={100}
            height={100}

        />
    );
}

function App(){

    return (
        <>
            <Welcome name="Iarilanja" />
            <Welcome name="Miantsa"/>
            <h2>Bienvenu dans notre tutoriel React</h2>
            <p>React est un bibliotheque javascript</p>
            <Avatar/>
        </>
    );
}

export default App;
